function SideBar(){this.sideBarControl=$(".nav-sidebar")}SideBar.prototype.run=function(){this.listenSideBarClickEvent()},SideBar.prototype.listenSideBarClickEvent=function(){this.sideBarControl.children("li").each(function(i,n){$(n).click(function(){$(n).addClass("active").siblings().removeClass("active")})})},$(function(){(new SideBar).run()});